package db.domain;public class PracticeGroupImpl implements PracticeGroup {	@Key	private String creator;	private String partner;	private long endTime;	private int x;	private int y;	private int mode;	private boolean isHarvest;	private int stealTimes;	public PracticeGroupImpl() {	}	public PracticeGroupImpl(PracticeGroup c) {		this.creator = c.getCreator();		this.partner = c.getPartner();		this.endTime = c.getEndTime();		this.x = c.getX();		this.y = c.getY();		this.mode = c.getMode();		this.isHarvest = c.getIsHarvest();		this.stealTimes = c.getStealTimes();	}	@Override	public String tableName() {		return "practice_group";	}	public void setCreator(String creator) {		this.creator = creator;	}	public String getCreator() {		return this.creator;	}public void addCreator(String creator) {		this.creator += creator;}	public void setPartner(String partner) {		this.partner = partner;	}	public String getPartner() {		return this.partner;	}public void addPartner(String partner) {		this.partner += partner;}	public void setEndTime(long endTime) {		this.endTime = endTime;	}	public long getEndTime() {		return this.endTime;	}public void addEndTime(long endTime) {		this.endTime += endTime;}	public void setX(int x) {		this.x = x;	}	public int getX() {		return this.x;	}public void addX(int x) {		this.x += x;}	public void setY(int y) {		this.y = y;	}	public int getY() {		return this.y;	}public void addY(int y) {		this.y += y;}	public void setMode(int mode) {		this.mode = mode;	}	public int getMode() {		return this.mode;	}public void addMode(int mode) {		this.mode += mode;}	public void setIsHarvest(boolean isHarvest) {		this.isHarvest = isHarvest;	}	public boolean getIsHarvest() {		return this.isHarvest;	}	public void setStealTimes(int stealTimes) {		this.stealTimes = stealTimes;	}	public int getStealTimes() {		return this.stealTimes;	}public void addStealTimes(int stealTimes) {		this.stealTimes += stealTimes;}}